import React, { useState } from 'react';
import { User, Mail, Phone, Edit3, Camera, LogOut } from 'lucide-react';

const Profile = () => {
  const [userInfo, setUserInfo] = useState({
    name: 'Chue Khin',
    email: 'chuekhin@gmail.com',
    phone: '+959123456789',
    avatar: null
  });

  const [isEditing, setIsEditing] = useState(false);
  const [editForm, setEditForm] = useState({ ...userInfo });

  const handleEditToggle = () => {
    if (isEditing) {
      // Save changes
      setUserInfo({ ...editForm });
    } else {
      // Start editing
      setEditForm({ ...userInfo });
    }
    setIsEditing(!isEditing);
  };

  const handleInputChange = (field, value) => {
    setEditForm(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleLogout = () => {
    if (window.confirm('Are you sure you want to log out?')) {
      // Handle logout logic here
      console.log('Logging out...');
    }
  };

  return (
    <div className="h-full bg-gradient-to-br from-teal-400 via-cyan-500 to-blue-600 p-6 overflow-y-auto">
      <div className="max-w-2xl mx-auto">
        {/* Profile Header */}
        <div className="text-center mb-8">
          <div className="relative inline-block mb-6">
            <div className="w-32 h-32 bg-white rounded-full flex items-center justify-center shadow-lg">
              {userInfo.avatar ? (
                <img 
                  src={userInfo.avatar} 
                  alt="Profile" 
                  className="w-full h-full rounded-full object-cover"
                />
              ) : (
                <User className="w-16 h-16 text-gray-400" />
              )}
            </div>
            <button className="absolute bottom-2 right-2 bg-white rounded-full p-2 shadow-lg hover:shadow-xl transition-shadow">
              <Camera className="w-4 h-4 text-gray-600" />
            </button>
          </div>

          <h1 className="text-3xl font-bold text-white mb-2">{userInfo.name}</h1>

          <button
            onClick={handleEditToggle}
            className="bg-white/20 backdrop-blur-sm text-white px-6 py-2 rounded-full hover:bg-white/30 transition-colors flex items-center space-x-2 mx-auto"
          >
            <Edit3 className="w-4 h-4" />
            <span>{isEditing ? 'Save Changes' : 'Edit Profile'}</span>
          </button>
        </div>

        {/* Account Information */}
        <div className="bg-white/10 backdrop-blur-sm rounded-lg p-8 mb-6">
          <h2 className="text-2xl font-semibold text-white mb-6">Account Information</h2>

          <div className="space-y-6">
            {/* Name Field */}
            <div className="flex items-center space-x-4">
              <div className="w-12 h-12 bg-white/20 rounded-lg flex items-center justify-center">
                <User className="w-6 h-6 text-white" />
              </div>
              <div className="flex-1">
                <label className="block text-white/80 text-sm font-medium mb-1">Name</label>
                {isEditing ? (
                  <input
                    type="text"
                    value={editForm.name}
                    onChange={(e) => handleInputChange('name', e.target.value)}
                    className="w-full px-3 py-2 bg-white/20 border border-white/30 rounded-lg text-white placeholder-white/60 focus:outline-none focus:ring-2 focus:ring-white/50"
                  />
                ) : (
                  <p className="text-white text-lg">{userInfo.name}</p>
                )}
              </div>
            </div>

            {/* Email Field */}
            <div className="flex items-center space-x-4">
              <div className="w-12 h-12 bg-white/20 rounded-lg flex items-center justify-center">
                <Mail className="w-6 h-6 text-white" />
              </div>
              <div className="flex-1">
                <label className="block text-white/80 text-sm font-medium mb-1">Email</label>
                {isEditing ? (
                  <input
                    type="email"
                    value={editForm.email}
                    onChange={(e) => handleInputChange('email', e.target.value)}
                    className="w-full px-3 py-2 bg-white/20 border border-white/30 rounded-lg text-white placeholder-white/60 focus:outline-none focus:ring-2 focus:ring-white/50"
                  />
                ) : (
                  <p className="text-white text-lg">{userInfo.email}</p>
                )}
              </div>
            </div>

            {/* Phone Field */}
            <div className="flex items-center space-x-4">
              <div className="w-12 h-12 bg-white/20 rounded-lg flex items-center justify-center">
                <Phone className="w-6 h-6 text-white" />
              </div>
              <div className="flex-1">
                <label className="block text-white/80 text-sm font-medium mb-1">Phone</label>
                {isEditing ? (
                  <input
                    type="tel"
                    value={editForm.phone}
                    onChange={(e) => handleInputChange('phone', e.target.value)}
                    className="w-full px-3 py-2 bg-white/20 border border-white/30 rounded-lg text-white placeholder-white/60 focus:outline-none focus:ring-2 focus:ring-white/50"
                  />
                ) : (
                  <p className="text-white text-lg">{userInfo.phone}</p>
                )}
              </div>
            </div>
          </div>
        </div>

        {/* Additional Profile Stats */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
          <div className="bg-white/10 backdrop-blur-sm rounded-lg p-4 text-center">
            <h3 className="text-2xl font-bold text-white">24</h3>
            <p className="text-white/80 text-sm">Conversations</p>
          </div>
          <div className="bg-white/10 backdrop-blur-sm rounded-lg p-4 text-center">
            <h3 className="text-2xl font-bold text-white">12</h3>
            <p className="text-white/80 text-sm">Knowledge Items</p>
          </div>
          <div className="bg-white/10 backdrop-blur-sm rounded-lg p-4 text-center">
            <h3 className="text-2xl font-bold text-white">7</h3>
            <p className="text-white/80 text-sm">Days Active</p>
          </div>
        </div>

        {/* Logout Button */}
        <div className="text-center">
          <button
            onClick={handleLogout}
            className="bg-red-500/20 backdrop-blur-sm text-white px-8 py-3 rounded-lg hover:bg-red-500/30 transition-colors flex items-center space-x-2 mx-auto border border-red-400/30"
          >
            <LogOut className="w-5 h-5" />
            <span>Log Out</span>
          </button>
        </div>
      </div>
    </div>
  );
};

export default Profile;
